import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Card,
  CardContent,
  CardHeader,
  CardTitle
} from '@/components/ui/card';
import {
  Tabs,
  TabsContent,
  TabsList,
  TabsTrigger
} from '@/components/ui/tabs';
import {
  Calendar,
  ClipboardList,
  FileText,
  Heart,
  User,
  Users,
  Clock
} from 'lucide-react';

const PatientDashboard = () => {
  const navigate = useNavigate();
  const [patientData, setPatientData] = useState({});
  const [doctors, setDoctors] = useState([]);
  const [appointments, setAppointments] = useState([]);
  const [careTeam, setCareTeam] = useState([]);
  const [prescriptions, setPrescriptions] = useState([]);
  const [recentActivities, setRecentActivities] = useState([]);

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/login');
    } else {
      fetchPatientProfile();
      fetchDoctors();
      fetchAppointments();
      fetchCareTeam();
      fetchPrescriptions();
      fetchRecentActivities();
    }
  }, []);

  const fetchPatientProfile = async () => {
    const token = localStorage.getItem('token');
    const response = await fetch('http://localhost:5000/api/patient/profile', {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    });
    const data = await response.json();
    setPatientData(data);
  };

  const fetchDoctors = async () => {
    const token = localStorage.getItem('token');
    const response = await fetch('http://localhost:5000/api/patient/doctors', {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    });
    const data = await response.json();
    setDoctors(data);
  };

  const fetchAppointments = async () => {
    const token = localStorage.getItem('token');
    const response = await fetch('http://localhost:5000/api/patient/appointments', {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    });
    const data = await response.json();
    setAppointments(data);
  };

  const fetchCareTeam = async () => {
    const token = localStorage.getItem('token');
    const response = await fetch('http://localhost:5000/api/patient/care-team', {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    });
    const data = await response.json();
    setCareTeam(data);
  };

  const fetchPrescriptions = async () => {
    const token = localStorage.getItem('token');
    const response = await fetch('http://localhost:5000/api/patient/prescriptions', {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    });
    const data = await response.json();
    setPrescriptions(data);
  };

  const fetchRecentActivities = async () => {
    const token = localStorage.getItem('token');
    const response = await fetch('http://localhost:5000/api/patient/recent-activity', {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    });
    if (response.ok) {
      const data = await response.json();
      setRecentActivities(data);
    } else {
      console.error('Failed to fetch recent activity');
    }
  };

  const renderDashboard = () => (
    <div className="grid gap-4 md:grid-cols-2 lg:grid-cols-3">
      <Card>
        <CardHeader>
          <CardTitle>Upcoming Appointments</CardTitle>
        </CardHeader>
        <CardContent>
          <ul className="space-y-2">
            {appointments.map((appointment, index) => (
              <li key={index} className="flex items-center space-x-2">
                <Calendar className="h-4 w-4 text-blue-600" />
                <span>{appointment.date} with {appointment.doctor}</span>
              </li>
            ))}
          </ul>
        </CardContent>
      </Card>

      <Card>
        <CardHeader>
          <CardTitle>Prescriptions</CardTitle>
        </CardHeader>
        <CardContent>
          <ul className="space-y-2">
            {prescriptions.map((prescription, index) => (
              <li key={index} className="flex items-center space-x-2">
                <FileText className="h-4 w-4 text-blue-600" />
                <span>{prescription.medication} - {prescription.dosage}</span>
              </li>
            ))}
          </ul>
        </CardContent>
      </Card>

      <Card>
        <CardHeader>
          <CardTitle>Recent Activity</CardTitle>
        </CardHeader>
        <CardContent>
          {recentActivities.length === 0 ? (
            <p className="text-sm text-gray-500">No recent activity available.</p>
          ) : (
            <ul className="space-y-2">
              {recentActivities.map((activity, index) => (
                <li key={index} className="flex items-center space-x-2">
                  {activity.type === "appointment_completed" && <User className="h-4 w-4 text-blue-600" />}
                  {activity.type === "test_result" && <Clock className="h-4 w-4 text-blue-600" />}
                  {activity.type === "prescription_added" && <FileText className="h-4 w-4 text-blue-600" />}
                  <span>{activity.details}</span>
                  <span className="text-xs text-gray-500 ml-2">{new Date(activity.timestamp).toLocaleString()}</span>
                </li>
              ))}
            </ul>
          )}
        </CardContent>
      </Card>

      <Card>
        <CardHeader>
          <CardTitle>Your Care Team</CardTitle>
        </CardHeader>
        <CardContent>
          <ul className="space-y-2">
            {careTeam.map((member, index) => (
              <li key={index} className="flex items-center space-x-2">
                <Users className="h-4 w-4 text-blue-600" />
                <span>{member.name} - {member.role}</span>
              </li>
            ))}
          </ul>
        </CardContent>
      </Card>

      <Card>
        <CardHeader>
          <CardTitle>Your Doctors</CardTitle>
        </CardHeader>
        <CardContent>
          <ul className="space-y-2">
            {doctors.map((doctor, index) => (
              <li key={index} className="flex items-center space-x-2">
                <Heart className="h-4 w-4 text-blue-600" />
                <span>{doctor.name} ({doctor.specialization})</span>
              </li>
            ))}
          </ul>
        </CardContent>
      </Card>
    </div>
  );

  return (
    <Tabs defaultValue="dashboard" className="w-full p-4">
      <TabsList className="mb-4">
        <TabsTrigger value="dashboard">Dashboard</TabsTrigger>
        <TabsTrigger value="appointments">Appointments</TabsTrigger>
        <TabsTrigger value="prescriptions">Prescriptions</TabsTrigger>
        <TabsTrigger value="care-team">Care Team</TabsTrigger>
      </TabsList>
      <TabsContent value="dashboard">{renderDashboard()}</TabsContent>
      <TabsContent value="appointments">
        <p>Manage your appointments here.</p>
      </TabsContent>
      <TabsContent value="prescriptions">
        <p>View and manage your prescriptions.</p>
      </TabsContent>
      <TabsContent value="care-team">
        <p>Meet your care team and their roles.</p>
      </TabsContent>
    </Tabs>
  );
};

export default PatientDashboard;
